import React from 'react';
import Chart from './Charts2';
import { thisExpression } from '@babel/types';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";


class NameForm extends React.Component {
    constructor(props) {
      super(props);
      this.state = {name: 'select', week: 'select', submitted: false};

      this.handleNameChange = this.handleNameChange.bind(this);
      this.handleWeekChange = this.handleWeekChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);


    }

    handleNameChange(event) {
        this.setState({name: event.target.value});
    }

    handleWeekChange(event) {
        this.setState({week: event.target.value});
    }

    handleSubmit(event) {
        (this.state.name == 'select') || (this.state.week == 'select') ? this.missingAlert() : this.state.submitted = true;
        event.preventDefault();
    }

    missingAlert() {
        this.state.submitted = false;
        alert("please fill in both your name and the week number")
    }
    renderChart() {
        return (
            <div>hi</div>
            // <Chart active_student={this.state.name} active_week={this.state.week}/>
        )
    }
    render() {
      return (
        <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/topics">Topics</Link>
          </li>
        </ul>

        <hr />

        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/topics" component={Topics} />
      </div>
    </Router>
      );
    }
  }

  function renderChart() {
      return( <div>hello</div>)
  }



function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}

function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}

function Topics({ match }) {
  return (
    <div>
      <h2>Topics</h2>
      <ul>
        <li>
          <Link to={`${match.url}/rendering`}>Rendering with React</Link>
        </li>
        <li>
          <Link to={`${match.url}/components`}>Components</Link>
        </li>
        <li>
          <Link to={`${match.url}/props-v-state`}>Props v. State</Link>
        </li>
      </ul>

      <Route path={`${match.path}/:topicId`} component={Topic} />
      <Route
        exact
        path={match.path}
        render={() => <h3>Please select a topic.</h3>}
      />
    </div>
  );
}

function Topic({ match }) {
  return (
    <div>
      <h3>{match.params.topicId}</h3>
    </div>
  );
}

export default BasicExample;
